import React from 'react';
import './Productcss';
import PropTypes from 'prop-types';

const Product = (props) => {
  return (
    <div className={`badgeNumber ${number > 50 ? 'red' : 'green'}`}>{number}</div>
  );
}

Product.propTypes = {
  url: PropTypes.number
};

export default Product;
